function add(a, b){
    const add = a+b;
    return add;
}
function subtract(a, b){
    const subtract = a-b;
    return subtract;
}
function multiply(a, b){
    const mul = a*b;
    return mul;
}
function divide(a, b){
    const div = a/b;
    return div;
}

export default add;
export {subtract, multiply, divide}
